import { summaryUrl } from "../utils/url";
import useData from '../utils/useData';
export const Stats = () => {
    const stats = useData(summaryUrl);
    console.log(stats);
    if (!stats)
        return "Fetching data please wait ...";
    return stats.meninggal;
};
